def find_kth_character(k):
    n = 0
    while (n * (n + 1)) // 2 < k:
        n += 1

    # Calculate the exact position of k within the concatenated string
    remaining_length = k - ((n - 1) * n // 2)
    current_char_index = remaining_length - 1

    # Determine the character at that position
    return chr((current_char_index % 26) + ord('a'))

def countSubstrings(s: str, k: int) -> int:
    n = len(s)
    count_0 = 0
    count_1 = 0
    left = 0
    result = 0

    for right in range(n):
        if s[right] == '0':
            count_0 += 1
        else:
            count_1 += 1

        while count_0 > k and count_1 > k:
            if s[left] == '0':
                count_0 -= 1
            else:
                count_1 -= 1
            left += 1

        result += right - left + 1

    return result

