def find_middle_brother():
    import sys
    input = sys.stdin.read
    data = input().split()
    S_AB, S_AC, S_BC = data[0], data[1], data[2]

    if S_AB == '<' and S_AC == '<':
        if S_BC == '<':
            print('B')
        else:
            print('C')
    elif S_AB == '<' and S_AC == '>':
        print('C')
    elif S_AB == '>' and S_AC == '<':
        print('A')
    elif S_AB == '>' and S_AC == '>':
        print('A')
    elif S_AB == '>' and S_BC == '<':
        print('B')

find_middle_brother()
